fall for the first time for studio 189: the award-winning fashion label founded by rosario dawson and abrima erwiah makes its inaugural bow at "fall / winter" fashion week. this means that going forward it will produce a collection twice a year. heretofore, it only produced a spring / summer collection ... incidentally, studio 189 has quite the pedigree: organic. eco-friendly. ethical fashion. made by artisan women in ghana.
